import React, { Component } from 'react' ;
import {connect} from 'react-redux';

class UserCheckined extends Component {
    render() {
        return (
            <div className ="login-state d-flex align-items-center" >
                <div className="user-name mr-30">
                    <div className="dropdown">
                        <a className="dropdown-toggle" href="#" role="button" id="userName" 
                            data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">{this.props.UserLogin.TaiKhoan}
                        </a>
                        <div className="dropdown-menu dropdown-menu-right" aria-labelledby="userName">
                            <a className="dropdown-item" href="#">Profile</a>
                            <a className="dropdown-item" href="#">Account Info</a>
                            <a className="dropdown-item" href="index.html" onClick={this}>Logout</a>
                        </div>
                    </div>
                </div>
                <div className="userthumb">
                    <img src="img/bg-img/t1.png" alt />
                </div>
            </div >
        )
    }
}



const mapStateToProps = state => {
    return {
        UserLogin : state.loginUser
    }
}
export default connect(mapStateToProps, null)(UserCheckined);
